import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App'; // Removed .tsx extension
import reportWebVitals from './reportWebVitals';

const rootElement = document.getElementById('root');
if (!rootElement) throw new Error('Failed to find the root element'); // Added null check

const root = ReactDOM.createRoot(rootElement); // Use the checked element
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals(console.log); // Added console.log argument
